import React from 'react'
import AttractionSummary from './AttractionSummary'
import { Link } from 'react-router-dom'

const AttractionList = ({attractionStats}) => {

        return (
            <div className="section">
            { attractionStats && attractionStats.map(attraction => {
                if (attraction.Type === "Attraction") {
                console.log(this.props.attractionInfo);
                return (
                    <Link to={'/attraction/' + attraction.Id} key={attraction.Id}>
                        <AttractionSummary attraction={attraction} key={attraction.Id} />
                    </Link>
                )
                } return null;
            })}  
            </div>
        )

}

export default AttractionList
